.find() returning nothing even when data exists<p>I've a mongo database with 3 collections for 3 different kind of users as User,Partner,Admin. Whenever a new user of any type signup I'm searching all three collections to check if username and email exist already. I'm trying to achieve this by calling a function as:</p>

<pre><code>function checkAttribute(attr,val,callback){
    User.find({attr: val},function(err,user){
        if(err){
            console.log(err);
        }else{
            if(user.length === 0){
                    Partner.find({attr: val},function(err,partner){
                    if(err){
                        console.log(err);
                    }else{
                        if(partner.length === 0){
                            Admin.find({attr: val},function(err,admin){
                                if(err){
                                    console.log(err);
                                }else{
                                    if(admin.length === 0){
                                        return callback(null,true);
                                    }else{
                                        return callback(null,false);
                                    } 
                                }
                            });
                        }else{
                            return callback(null,false);
                        }
                    }
                });
            }else{
                return callback(null,false);
            }
        }
    });
};
</code></pre>

<p>Calling function line:</p>

<pre><code>checkAttribute("username",newUser.username,function(error,response){
.......
});
</code></pre>

<p>But this is not working as it returns true always even when users with passed username/email exists already. I am unable to find the problem. Any one knows why this is happening? 
Thanks in advance.</p>

