</code></pre>

<p>These calls were done with cloud code and they do not return the required results that were found in MongoDB Compass. No errors are thrown due to syntax, there are simply no results. Are there any restrictions within the parse aggregation calls that would explain why the call is failing?</p>; Answer: The problem with this (and ivan's below), is that all parameters will be evaluated.  So, if I write `Dim thingie = Coalesce(Session("thingie"), new Thingie)` a new Thingie object will be created every time (although it will be thrown away if a Thingie exist in the Session)

