Mongodb aggregation match ends with using field value<p>note: I'm using Mongodb 4 and I must use aggregation, because this is a step of a bigger aggregation</p>

<p><strong>Problem</strong></p>

<p>How to find in a collection documents that contains fields that ends with value from another field in same document ?</p>

<p>Let's start with this collection:</p>

<pre><code>db.regextest.insert([
{"first":"Pizza", "second" : "Pizza"},
{"first":"Pizza", "second" : "not pizza"},
{"first":"Pizza", "second" : "not pizza"}
])
</code></pre>

<p>and an example query for exact match:</p>

<pre><code>db.regextest.aggregate([
{
    $match :  { $expr: { $eq: [ "$first" ,"$second" ] }   }    }
])
</code></pre>

<p>I will get a single document</p>

<pre><code>{
    "_id" : ObjectId("5c49d44329ea754dc48b5ace"),
    "first" : "Pizza",    "second" : "Pizza"
}
</code></pre>

<p>And this is good.</p>

<p>But how to do the same, but with endsWith? </p>

<p>I've openend another question for <a href="https://stackoverflow.com/questions/54365355/mongodb-regex-in-aggregation-using-reference-to-field-value">start with</a> here that uses <code>indexOfBytes</code> . But indexOf return only first match, and not last one</p>

<p><strong>Edit</strong>: I've found an acceptable answer (with a lot of custom logic, my hope is Mongodb team will solve this), here the solution:</p>

<pre><code>db.regextest.aggregate([
    {
        $addFields : {
            "tmpContains" : { $indexOfBytes: [ "$first", { $ifNull : [ "$second" , 0] }  ] }
        }
    },
    {
        $match: { "tmpContains" : { $gt : -1 } }
    },
    {
        $addFields : {
            "firstLen" : { $strLenBytes: "$first" }
        }
    },
    {
        $addFields : {
            "secondLen" : { $strLenBytes: "$second" }
        }
    },
    {
        $addFields : {
            "diffLen" : { $abs: { $subtract : [ "$firstLen", "$secondLen"] } }
        }
    },
    {
        $addFields : {
           "res" : { $substr:  [ "$first", "$diffLen", "$firstLen"] }
        }
    },
    {
        $match : { $expr : { $eq: [ "$res" , "$second" ] }}
    }
])
</code></pre>

