    return list;

}

export default Resources;
</code></pre>

<p>But I don't know how I can expose the database in a function that could be accessed from pages anywhere in the app. It seems that older tutorials of examples used something like <code>server.use((req, res, next) =&gt; { req.db = dbToExpose });</code> in the main <code>index.js</code> file, but this doesn't seem to be working with Next.js v. 6?? </p>

<p><em>For example, <a href="https://github.com/vkarpov15/reading-list" rel="nofollow noreferrer">this sample repo</a> from <a href="http://thecodebarbarian.com/building-a-nextjs-app-with-mongodb.html" rel="nofollow noreferrer">this tutorial</a> doesn't seem to work for me with the latest version of Next.js. The db exposed trough <code>req.db</code> comes up as 'undefined' when you try to access it from a a page. But perhaps I am missing some other problem.</em></p>

<p>Here's my attempt in my base server file at exposing the db so I can access it from files in <code>pages/</code>:</p>

<pre><code>const express = require('express')
const next = require('next')
const monk = require('monk')('localhost/myDatabase')

const dev = process.env.NODE_ENV !== 'production'
