MongoDb sequential int id generator for C# class hierarchy<p>I have a C# classes hierarchy with separated BsonClass mappings. All my classes use custom sequential int id generation. Last Id stored in special collection called "Counter". My problem is when mongo collection methods like InsertOneAsync get called InvalidCastException is thrown.</p>

<p>Base Entity class:</p>

<pre><code>[Serializable]
public abstract class Entity&lt;TIdentifier&gt; : IEntity&lt;TIdentifier&gt;
{
    public TIdentifier Id { get; set; }

    public DateTime CreatedDate { get; set; }

    public DateTime UpdatedDate { get; set; }

    public virtual bool IsTransient()
    {
        return (object) this.Id == null || this.Id.Equals((object) default (TIdentifier));
    }
}
</code></pre>

<p>Child class:</p>

<pre><code>public class Child : Entity&lt;int&gt; 
{
    public int SomeData { get; set; }
}
</code></pre>

<p>Base class map:</p>

<pre><code>public class EntityMap
{
    public static void Register()
    {
        BsonClassMap.RegisterClassMap&lt;Entity&lt;int&gt;&gt;(cm =&gt;
        {
            cm.AutoMap();
            cm.MapIdProperty(c =&gt; c.Id)
                .SetIdGenerator(SeqIntIdGenerator&lt;Entity&lt;int&gt;&gt;.Instance)
                .SetSerializer(new Int32Serializer(BsonType.Int32));
        });
    }
}
</code></pre>

<p>Child class map:</p>

<pre><code>public class ChildMap
{
    public static void Register()
    {
        BsonClassMap.RegisterClassMap&lt;Child&gt;(cm =&gt;
        {
            cm.AutoMap();
            cm.SetIgnoreExtraElements(true);
        });
    }
}
</code></pre>

<p>Sequential int id generator class:</p>

<pre><code>public class SeqIntIdGenerator&lt;TEntity&gt; : IIdGenerator
{
    public static SeqIntIdGenerator&lt;TEntity&gt; Instance { get; } = new SeqIntIdGenerator&lt;TEntity&gt;();

    public object GenerateId(object container, object document)
    {
